import { Link } from "react-router-dom";
import "./style.css";

const Post = ({ post }) => {
  return (
    <div>
      <div className="post">
        <div className="post_header">
          <Link
            to={`/profile/${post.user.username}`}
            className="post_header_left"
          ></Link>
        </div>
      </div>
    </div>
  );
};

export default Post;
